import "./App.css";
// import {Link} from 'react-router-dom'
import {Route} from "react-router";
import Producten from "./components/Producten"
import BestelLijst from "./components/Bestellijst"

function App() {
    return (
        <ul>
            <li> <Route path="/" component={App}>Home</Route></li>
            <li> <Route path="/producten" component={Producten}>Producten</Route></li>
            <li> <Route path="/bestellijst" component={BestelLijst}>Bestellijst</Route></li>
        </ul>
    );
}

export default App;
